import React, { useState } from 'react';
import ChatAssistantModal from 'openagi_app\src\components\ChatAssistantModal.js';

const RunStackPage = () => {
  const [showChat, setShowChat] = useState(false);

  const handleRunClick = () => {
    setShowChat(true);
  };

  const handleCloseChat = () => {
    setShowChat(false);
  };

  return (
    <div style={styles.page}>
      <h1>Run Stack</h1>
      <button style={styles.button}>Build</button>
      <button onClick={handleRunClick} style={styles.button}>Run</button>
      {showChat && <ChatAssistantModal onClose={handleCloseChat} />}
    </div>
  );
};

const styles = {
  page: {
    padding: '20px'
  },
  button: {
    padding: '10px 20px',
    fontSize: '1em',
    cursor: 'pointer',
    margin: '10px'
  }
};

export default RunStackPage;
